content:
@_RobinD Jmf med Storytel och hur dom aktivt köpt upp förlag för att äga innehållet. 

Readly är liksom bara en app... 

Spotify är liknande men deras marknadsposition är ju enorm i jämförelse med Readly.

@BingoBahMer Jag gillar produkten.

Osäker däremot på om tidskrifter i sin nuvarande form är framtiden. 

Ser dock ingen anledning till varför inte Readly skulle kunna förändras i takt med (om?) magasinen förändras.

@noobmaklare Sättet som de förändrar sig är att göra samma sak på nya sätt. Utgåvor t.ex. Det räknas fortfarande utgåvor när annonser ska värderas. En PDF är en utgåva, alltså finns Readly. 
Vi byggde en bättre läsare, men var tvungna att också ha med pdf.
De lyckas inte innovera sig.

@BingoBahMer @appmiljonaren Sant, algoritmerna klappar oss medhårs.
Mig ger Readly det jag inte visste fanns, bra tyska tidningar om husrenovering, stennördiga Linux tidningar, magiska biltidningar. Skidåkning, cykel, vassa ekonomitidningar.
Kanske ska teckna allafall :-)

@anders_hedman @OMX_S Går att ställa in så låtar går in i varandra när de byts har jag för mig.

För att svara OP, älskar spotify, kommer vara kund resten av livet och rekryterar vänner som inte har!

Aldrig haft readly eller annat tidningsabonnemang.. det viktigaste finns på twitter. N=1

Börsintroduktion - Readly AB 🔔

@ReadlySweden grundades 2012 och är marknadsledare i Europa inom kategorin digitala magasin. Readly erbjuder kunder en digital prenumerationstjänst av magasin med innehåll från tredjepartsförlag.

Läs mer 👉 https://t.co/elTwl4z822 https://t.co/a6Er5uMaCl

